import React from "react";
import {
  View,
  KeyboardAvoidingView,
  Image,
  TextInput,
  TouchableOpacity,
  Text,
} from 'react-native';

export default function App() {
  return (
    <KeyboardAvoidingView>
      <View>
        <Image source={require("./src/assets/logo.png")} />
      </View>

      <View>
        <TextInput>
          placeholder="Email" autocorrect={false}
          onChangeText={() => {}}
        </TextInput>

        <TextInput>
          placeholder="Senha" autocorrect={false}
          onChangeText={() => {}}
        </TextInput>

        <TouchableOpacity>
          <Text>Acessar</Text>
        </TouchableOpacity>

        <TouchableOpacity>
          <Text>Criar conta gratuita</Text>
        </TouchableOpacity>
      </View>
    </KeyboardAvoidingView>
  );
}
